import React, { Component, Fragment } from 'react';
import './MainPage.scss';

class MainPage extends Component {
    render() {
        return (
            <Fragment>
                <div className="main-page">1</div>
                <div className="main-page__word">Тестим стили</div>
            </Fragment>
        );
    }
};

export default MainPage;
